  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes the results of a
  study on the reproductive success of Black-legged Kittiwakes (Rissa tridactyla)
  and two species of cormorants. Populations of Pelagic Cormorants, Red-faced Cormorants,
  Glaucous-winged Gulls, Common Murres, and Pigeon Guillemots are also estimated.
  A description of the study area, methods used, and a discussion of the results is
  covered. Management recommendations are also included.\",\n\t\"license_title\":
